<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>ScoreHub Pro</title>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/PapaParse/5.3.2/papaparse.min.js"></script>
    <script src="https://cdn.tailwindcss.com"></script>
    <link href="https://fonts.googleapis.com/css2?family=Inter:wght@400;600;800;900&family=Roboto+Mono:wght@700&display=swap" rel="stylesheet">
    <style>
        :root { --accent: #00ff85; --bg: #0b0e11; --card: #161b22; --border: #30363d; }
        body { background: var(--bg); color: #fff; font-family: 'Inter', sans-serif; letter-spacing: -0.02em; overflow-x: hidden; }
        header { background: rgba(11, 14, 17, 0.95); backdrop-filter: blur(12px); border-bottom: 1px solid var(--border); position: fixed; top: 0; width: 100%; max-width: 448px; z-index: 100; }

        .date-nav { display: flex; align-items: center; justify-content: space-between; padding: 16px; margin-top: 70px; }
        .date-display { font-weight: 900; font-size: 14px; text-transform: uppercase; text-align: center; flex: 1; }
        .nav-arrow { width: 36px; height: 36px; background: #222; border-radius: 50%; display: flex; align-items: center; justify-content: center; cursor: pointer; font-size: 20px; font-weight: bold; }
        .today-btn { background: var(--accent); color: #000; font-size: 10px; font-weight: 900; padding: 6px 14px; border-radius: 6px; cursor: pointer; margin-top: 4px; }

        .league-container { background: #121212; border-radius: 16px; margin: 12px; overflow: hidden; border: 1px solid #222; }
        .league-header { background: #1a1a1a; padding: 12px 16px; display: flex; align-items: center; gap: 8px; font-weight: 800; font-size: 13px; color: #fff; border-bottom: 1px solid #222; }
        .league-logo { width: 20px; height: 20px; object-fit: contain; }
        .match-row { display: flex; align-items: center; padding: 16px; border-bottom: 1px solid #1a1a1a; }
        .team-box { display: flex; align-items: center; gap: 10px; flex: 1; }
        .team-logo { width: 24px; height: 24px; object-fit: contain; }
        .team-name { font-size: 13px; font-weight: 700; }
        .match-info { display: flex; flex-direction: column; align-items: center; min-width: 60px; }
        .match-score { font-family: 'Roboto Mono', monospace; font-weight: 900; font-size: 16px; color: var(--accent); }

        .qualify-indicator { width: 4px; height: 24px; border-radius: 2px; margin-right: 10px; }
        .active-league { background: var(--accent) !important; color: #000 !important; }

        .nav-bottom { position: fixed; bottom: 0; width: 100%; max-width: 448px; background: #111; border-top: 1px solid #222; display: flex; justify-content: space-around; padding: 12px 0; z-index: 100; }
        .nav-item { color: #555; font-size: 10px; font-weight: 800; text-align: center; cursor: pointer; display: flex; flex-direction: column; align-items: center; gap: 2px; }
        .nav-item.active { color: var(--accent); }
        .player-avatar { width: 80px; height: 80px; border-radius: 50%; background: #222; display: flex; align-items: center; justify-content: center; font-size: 32px; font-weight: 900; color: #666; }
        .player-avatar-img { width: 80px; height: 80px; border-radius: 50%; object-fit: cover; background: #222; border: 1px solid #2a2a2a; }
        .stat-card { background: #1a1a1a; border-radius: 12px; padding: 16px; border: 1px solid #222; }
        .search-input { background: #1a1a1a; border: 1px solid #333; border-radius: 8px; padding: 12px 16px; color: #fff; width: 100%; font-size: 14px; }
        .search-input:focus { outline: none; border-color: var(--accent); }
        .header-search-input { background: #1a1a1a; border: 1px solid #333; border-radius: 10px; padding: 8px 10px; color: #fff; width: 170px; font-size: 12px; }
        .header-search-input:focus { outline: none; border-color: var(--accent); }

        .player-logo-dup { display:none !important; }

        .search-suggestions{
            position:absolute;
            right:16px;
            top:64px;
            background:#1a1a1a;
            border:1px solid #333;
            border-radius:10px;
            width:300px;
            max-height:320px;
            overflow-y:auto;
            z-index:200;
        }
        .search-suggestion{
            padding:10px 12px;
            cursor:pointer;
            font-size:12px;
            display:flex;
            align-items:center;
            gap:10px;
        }
        .search-suggestion:hover{ background:#222; }

        .leader-pill{
            background:#111;
            border:1px solid #2a2a2a;
            border-radius:12px;
            padding:12px;
            cursor:pointer;
        }
        .rating-badge{font-family:'Roboto Mono',monospace;font-weight:900;font-size:12px;min-width:42px;text-align:center;border-radius:10px;padding:6px 8px;display:inline-flex;align-items:center;justify-content:center;border:1px solid #2a2a2a;}
        .rating-elite{background:rgba(34,197,94,.18);color:#22c55e;border-color:rgba(34,197,94,.35);}
        .rating-good{background:rgba(134,239,172,.16);color:#86efac;border-color:rgba(134,239,172,.35);}
        .rating-ok{background:rgba(250,204,21,.16);color:#facc15;border-color:rgba(250,204,21,.35);}
        .rating-bad{background:rgba(239,68,68,.16);color:#ef4444;border-color:rgba(239,68,68,.35);}
.leader-pill:hover{ border-color:#00ff85; }
    </style>
</head>
<body class="max-w-md mx-auto pb-24">

    <header class="p-4">
        <div class="flex items-center justify-between gap-3 relative">
            <h1 class="text-xl font-black italic uppercase cursor-pointer select-none" onclick="switchTab('hub'); jumpToToday();">Score<span class="text-[#00ff85]">Hub</span></h1>
            <input type="text" id="globalSearch" class="header-search-input" placeholder="Search teams or players..." onkeyup="searchPlayer(event)" oninput="queueSuggestions('globalSearch', 'globalSearchSuggestions')" onfocus="queueSuggestions('globalSearch', 'globalSearchSuggestions')">
            <div id="globalSearchSuggestions" class="search-suggestions hidden"></div>
        </div>
    </header>

    <main id="hub-tab">
        <div class="date-nav">
            <div class="nav-arrow" onclick="changeDate(-1)">‚Äπ</div>
            <div class="flex flex-col items-center">
                <div class="date-display" id="dateText">Loading...</div>
                <div class="today-btn" onclick="jumpToToday()">JUMP TO TODAY</div>
            </div>
            <div class="nav-arrow" onclick="changeDate(1)">‚Ä∫</div>
        </div>
        <div id="league-list"></div>
    </main>

    <div id="standings-tab" class="hidden pt-20">
        <div class="flex gap-2 px-4 py-4 overflow-x-auto no-scrollbar">
            <button id="btn-PREM" onclick="renderStandings('PREM')" class="league-btn text-[10px] font-black bg-zinc-800 px-5 py-2.5 rounded-full whitespace-nowrap active-league">PREMIER LEAGUE</button>
            <button id="btn-LALIGA" onclick="renderStandings('LALIGA')" class="league-btn text-[10px] font-black bg-zinc-800 px-5 py-2.5 rounded-full whitespace-nowrap">LA LIGA</button>
            <button id="btn-MLS" onclick="renderStandings('MLS')" class="league-btn text-[10px] font-black bg-zinc-800 px-5 py-2.5 rounded-full whitespace-nowrap">MLS</button>
        </div>

        <div class="px-2 overflow-x-auto">
            <div class="bg-zinc-900/50 rounded-xl border border-zinc-800 min-w-[600px]">
                <table class="w-full text-left text-[11px]">
                    <thead><tr id="standingsHead" class="uppercase bg-zinc-800/50"></tr></thead>
                    <tbody id="standingsBody"></tbody>
                </table>
            </div>
        </div>

        <div id="legend" class="mt-6 px-4 flex flex-wrap gap-4"></div>
    </div>

    <div id="stats-tab" class="hidden pt-20 pb-6">
        <div class="flex gap-2 px-4 py-4 overflow-x-auto no-scrollbar">
            <button id="stat-btn-PREM" onclick="renderStats('PREM')" class="league-btn text-[10px] font-black bg-zinc-800 px-5 py-2.5 rounded-full whitespace-nowrap active-league">PREMIER LEAGUE</button>
            <button id="stat-btn-LALIGA" onclick="renderStats('LALIGA')" class="league-btn text-[10px] font-black bg-zinc-800 px-5 py-2.5 rounded-full whitespace-nowrap">LA LIGA</button>
            <button id="stat-btn-MLS" onclick="renderStats('MLS')" class="league-btn text-[10px] font-black bg-zinc-800 px-5 py-2.5 rounded-full whitespace-nowrap">MLS</button>
            <button id="stat-btn-COMBINED" onclick="renderStats('COMBINED')" class="league-btn text-[10px] font-black bg-zinc-800 px-5 py-2.5 rounded-full whitespace-nowrap">COMBINED</button>
        </div>
        <div id="statsContent" class="px-4"></div>
    </div>

    <div id="team-tab" class="hidden pt-20 pb-6">
        <div class="px-4">
            <button onclick="backToView()" class="text-[10px] font-black text-[#00ff85] mb-4">‚Üê BACK</button>
            <div id="teamContent"></div>
        </div>
    </div>

    <div id="player-tab" class="hidden pt-20 pb-6">
        <div class="px-4">
            <button onclick="backToView()" class="text-[10px] font-black text-[#00ff85] mb-4">‚Üê BACK</button>
            <div id="playerContent"></div>
        </div>
    </div>

    <nav class="nav-bottom">
        <div class="nav-item active" onclick="switchTab('hub')">
            <span class="text-lg">‚öΩ</span>
            <span>MAIN HUB</span>
        </div>
        <div class="nav-item" onclick="switchTab('standings')">
            <span class="text-lg">üèÜ</span>
            <span>STANDINGS</span>
        </div>
        <div class="nav-item" onclick="switchTab('stats')">
            <span class="text-lg">üìä</span>
            <span>STATS</span>
        </div>
    </nav>

function _normMatch(s) {
    return (s || '')
        .toString()
        .toLowerCase()
        .replace(/[^a-z0-9]+/g, ' ')
        .trim()
        .replace(/\s+/g, ' ');
}

function normalizeName(str) {
    // Strong normalization:
    // - lower
    // - remove accents/diacritics
    // - map special letters (√∏, √¶, √ü, etc.) to plain ascii
    // - strip punctuation into spaces
    // - collapse whitespace
    let s = (str || "").toString().toLowerCase();

    // Map common special letters that don't reliably decompose under NFD
    const repl = {
        "√∏":"o","≈ì":"oe","√¶":"ae","√ü":"ss","ƒë":"d","√∞":"d","√æ":"th","≈Ç":"l","ƒß":"h","ƒ±":"i","≈ã":"n",
        "ƒç":"c","ƒá":"c","≈°":"s","≈æ":"z","ƒü":"g","≈ü":"s","√±":"n","√°":"a","√†":"a","√§":"a","√¢":"a","√£":"a","√•":"a",
        "√©":"e","√®":"e","√´":"e","√™":"e","√≠":"i","√¨":"i","√Ø":"i","√Æ":"i","√≥":"o","√≤":"o","√∂":"o","√¥":"o","√µ":"o",
        "√∫":"u","√π":"u","√º":"u","√ª":"u","√Ω":"y","√ø":"y"
    };
    s = s.replace(/[√∏≈ì√¶√üƒë√∞√æ≈Çƒßƒ±≈ãƒçƒá≈°≈æƒü≈ü√±√°√†√§√¢√£√•√©√®√´√™√≠√¨√Ø√Æ√≥√≤√∂√¥√µ√∫√π√º√ª√Ω√ø]/g, ch => repl[ch] || ch);

    // Remove diacritics
    s = s.normalize("NFD").replace(/[\u0300-\u036f]/g, "");

    // Treat apostrophes/hyphens/dots as separators (handles "O'Neil", "Jean-Pierre", "J. Bellingham")
    s = s.replace(/[^a-z0-9]+/g, " ");

    return s.trim().replace(/\s+/g, " ");
}

function _editDistance(a, b, limit = 999) {
    if (a === b) return 0;
    if (!a) return (b || "").length;
    if (!b) return (a || "").length;

    const al = a.length, bl = b.length;
    if (Math.abs(al - bl) > limit) return limit + 1;

    const prev = new Array(bl + 1);
    const curr = new Array(bl + 1);
    for (let j = 0; j <= bl; j++) prev[j] = j;

    for (let i = 1; i <= al; i++) {
        curr[0] = i;
        let minRow = curr[0];
        const ca = a.charCodeAt(i - 1);
        for (let j = 1; j <= bl; j++) {
            const cost = ca === b.charCodeAt(j - 1) ? 0 : 1;
            const v = Math.min(prev[j] + 1, curr[j - 1] + 1, prev[j - 1] + cost);
            curr[j] = v;
            if (v < minRow) minRow = v;
        }
        if (minRow > limit) return limit + 1;
        for (let j = 0; j <= bl; j++) prev[j] = curr[j];
    }
    return prev[bl];
}

let __PHOTO_INDEX_READY = false;
let __PHOTO_BUCKET_FIRST = {};
let __PHOTO_BUCKET_SURNAME = {};
let __PHOTO_ALL_KEYS = [];

function _ensurePhotoIndex() {
    if (__PHOTO_INDEX_READY) return;

    __PHOTO_ALL_KEYS = (PHOTO_NAME_LIST || []).slice();
    __PHOTO_BUCKET_FIRST = {};
    __PHOTO_BUCKET_SURNAME = {};

    for (const k of __PHOTO_ALL_KEYS) {
        if (!k) continue;
        const fc = k[0];
        if (!__PHOTO_BUCKET_FIRST[fc]) __PHOTO_BUCKET_FIRST[fc] = [];
        __PHOTO_BUCKET_FIRST[fc].push(k);

        const parts = k.split(" ").filter(Boolean);
        const surname = parts.length ? parts[parts.length - 1] : "";
        if (surname) {
            if (!__PHOTO_BUCKET_SURNAME[surname]) __PHOTO_BUCKET_SURNAME[surname] = [];
            __PHOTO_BUCKET_SURNAME[surname].push(k);
        }
    }

    __PHOTO_INDEX_READY = true;
}

function _pickBestPhotoKey(normalizedName) {
    _ensurePhotoIndex();
    const original = normalizedName;
    if (!original) return null;

    // Build a small set of query variants to handle:
    // - first+last only
    // - first initial + last
    // - missing middle names
    // - minor misspellings
    const tokens = original.split(" ").filter(Boolean);
    const first = tokens[0] || "";
    const last = tokens.length ? tokens[tokens.length - 1] : "";
    const firstInitial = first ? first[0] : "";

    const variants = [];
    const pushV = (v) => { if (v && !variants.includes(v)) variants.push(v); };

    pushV(original);
    if (tokens.length >= 2) pushV(first + " " + last);
    if (tokens.length >= 2 && firstInitial) pushV(firstInitial + " " + last);
    if (last) pushV(last);

    // Candidate pool strategy:
    // 1) Try exact-surname bucket (fast & accurate)
    // 2) If that fails (surname misspelled), use first-letter bucket
    // 3) Fall back to a capped global list
    const pools = [];
    if (last && __PHOTO_BUCKET_SURNAME[last]) pools.push(__PHOTO_BUCKET_SURNAME[last]);
    if (firstInitial && __PHOTO_BUCKET_FIRST[firstInitial]) pools.push(__PHOTO_BUCKET_FIRST[firstInitial]);
    pools.push(__PHOTO_ALL_KEYS);

    // Scoring:
    // - exact match wins
    // - substring containment wins
    // - else edit distance with a length-based threshold
    // Additional guardrails:
    // - prefer candidates that share the last token prefix if we have a last name
    // - cap evaluations for speed
    let bestKey = null;
    let bestDist = 1e9;

    for (const q of variants) {
        if (!q) continue;

        const qTokens = q.split(" ").filter(Boolean);
        const qLast = qTokens.length ? qTokens[qTokens.length - 1] : "";
        const qFirst = qTokens[0] || "";
        const qFirstInitial = qFirst ? qFirst[0] : "";

        // dynamic threshold: allow 1‚Äì3 edits depending on length
        const lim = Math.max(1, Math.min(4, Math.floor(q.length * 0.22)));

        // Merge pools with de-dup
        const seen = new Set();
        let candidates = [];
        for (const p of pools) {
            if (!p) continue;
            // cap per pool to avoid huge loops
            const cap = (p === __PHOTO_ALL_KEYS) ? 1200 : 900;
            for (let i = 0; i < p.length && candidates.length < 2200; i++) {
                const k = p[i];
                if (!k || seen.has(k)) continue;
                seen.add(k);
                candidates.push(k);
                if (i >= cap) break;
            }
        }

        // Narrow by last-name prefix if we have one (handles tiny surname misspellings)
        if (qLast && qLast.length >= 4) {
            const pref = qLast.slice(0, 4);
            const narrowed = candidates.filter(k => k.includes(pref));
            if (narrowed.length >= 20) candidates = narrowed;
        }

        // Evaluate
        for (let i = 0; i < candidates.length; i++) {
            const k = candidates[i];

            if (k === q) return k;

            // Strong wins
            if (qLast && k.includes(qLast) && qFirst && k.includes(qFirst)) return k;
            if (qLast && k.includes(qLast) && qFirstInitial && k.includes(qFirstInitial + " ")) {
                // matches "j bellingham" style
                return k;
            }
            if (k.includes(q) && q.length >= 6) {
                // near-exact containment
                return k;
            }

            const d = _editDistance(q, k, lim);
            if (d < bestDist) {
                bestDist = d;
                bestKey = k;
                if (bestDist === 0) break;
            }
        }

        if (bestKey && bestDist <= lim) return bestKey;
    }

    return null;
}

function getPlayerPhotoUrl(playerName, teamName) {
    const n = normalizeName(playerName);
    if (!n) return null;

    // 1) Exact match against our precomputed aliases
    let id = PHOTO_ALIAS_MAP.get(n) || null;
    if (id) return getLocalPhotoById(id);

    // 2) Common variants (no team/club usage)
    const parts = n.split(" ").filter(Boolean);
    const variants = [];

    // First + last
    if (parts.length >= 2) variants.push(parts[0] + " " + parts[parts.length - 1]);
    // First initial + last
    if (parts.length >= 2) variants.push((parts[0][0] || "") + " " + parts[parts.length - 1]);

    // If short name style was passed like "j bellingham" already handled above; still try removing middle names.
    if (parts.length >= 3) variants.push(parts[0] + " " + parts[parts.length - 1]);

    for (const v of variants) {
        id = PHOTO_ALIAS_MAP.get(v) || null;
        if (id) return getLocalPhotoById(id);
    }

    // 3) Fuzzy match (fast, bucketed) against our alias keyspace
    const bestKey = _pickBestPhotoKey(n);
    if (bestKey) {
        id = PHOTO_ALIAS_MAP.get(bestKey) || null;
        if (id) return getLocalPhotoById(id);
    }

    return null;
}

function getInitials(name) {
    const parts = (name || "").toString().trim().split(/\s+/).filter(Boolean);
    if (!parts.length) return "";
    const letters = parts.map(p => (p[0] || "")).join("").toUpperCase();
    return letters.slice(0, 2);
}

function renderPlayerAvatarHTML(playerName, teamName) {
    const url = getPlayerPhotoUrl(playerName, teamName);
    const initials = getInitials(playerName);
    if (url) {
        // If the local file is missing, fall back to initials (no broken image icon).
        return `<img src="${url}" class="player-avatar-img" alt="${playerName || 'Player'}" onerror="this.outerHTML='<div class=&quot;player-avatar&quot;>' + '${initials}' + '</div>';">`;
    }
    return `<div class="player-avatar">${initials}</div>`;
}

// --- Standings cache + helpers (for Team page table snapshot) ---
let standingsCache = {};

// Loads standings rows for a league once, returns sorted array by position.
// Each row: { pos:number, team:string, wdl:string, pts:number, mp:number }
function loadStandingsData(lg) {
    if (standingsCache[lg] && standingsCache[lg].loaded) return Promise.resolve(standingsCache[lg].rows);

    standingsCache[lg] = { loaded: false, rows: [] };

    return new Promise((resolve) => {
        Papa.parse(STANDINGS_URLS[lg], {
            download: true,
            header: true,
            complete: (res) => {
                const rows = (res.data || []).map(r => {
                    let pos = r.Position || r.position || r['#'] || '';
                    let team = r.Team || r.team || '';
                    const fixed = _stripLeadingPosFromTeam(pos, team);
                    pos = fixed.pos;
                    team = fixed.team;

                    const mp = parseInt((r.MP || r.mp || 0), 10);
                    const pts = parseInt((r.Points || r.Pts || r.points || 0), 10);
                    const wdl = (r['W-D-L'] || r['WDL'] || r['WDL '] || '').toString().trim();

                    const posNum = parseInt(pos, 10);
                    return {
                        pos: Number.isNaN(posNum) ? 999 : posNum,
                        team: team,
                        wdl: wdl || '0-0-0',
                        pts: Number.isNaN(pts) ? 0 : pts,
                        mp: Number.isNaN(mp) ? 0 : mp
                    };
                }).filter(r => r.team);

                rows.sort((a,b) => a.pos - b.pos);

                standingsCache[lg] = { loaded: true, rows };
                resolve(rows);
            },
            error: () => {
                standingsCache[lg] = { loaded: true, rows: [] };
                resolve([]);
            }
        });
    });
}

function parseSheetDate(raw) {
    if (!raw) return null;
    const str = raw.trim();
    const monthNameRegex = /(Jan|Feb|Mar|Apr|May|Jun|Jul|Aug|Sep|Oct|Nov|Dec|January|February|March|April|June|July|August|September|October|November|December)/i;
    if (/matchday/i.test(str) || (!monthNameRegex.test(str) && /^\s*\d+[A-Z]?\b/i.test(str))) return 'MATCHDAY_MARKER';

    const monthMap = {
        "January": 0, "February": 1, "March": 2, "April": 3, "May": 4, "June": 5,
        "July": 6, "August": 7, "September": 8, "October": 9, "November": 10, "December": 11,
        "Jan": 0, "Feb": 1, "Mar": 2, "Apr": 3, "Jun": 5,
        "Jul": 6, "Aug": 7, "Sep": 8, "Oct": 9, "Nov": 10, "Dec": 11
    };

    const has2025 = str.includes('2025');
    let match = str.match(/(Jan|Feb|Mar|Apr|May|Jun|Jul|Aug|Sep|Oct|Nov|Dec|January|February|March|April|May|June|July|August|September|October|November|December)\.?\s*(\d+)/i);
    if (match) {
        const monthStr = match[1];
        const day = parseInt(match[2], 10);
        let month = -1;
        for (let key in monthMap) {
            if (key.toLowerCase() === monthStr.toLowerCase()) { month = monthMap[key]; break; }
        }
        if (month === -1) return null;
        const year = has2025 ? 2025 : 2026;
        const d = new Date(year, month, day);
        d.setHours(0, 0, 0, 0);
        return d;
    }
    return null;
}

function _stripLeadingPosFromTeam(pos, team) {
    const t = (team || '').toString().trim();
    const p = (pos || '').toString().trim();
    const m = t.match(/^\s*(\d{1,2})\s*[\.\)\-:]?\s+(.+)\s*$/);
    if (!m) return { pos: p, team: t };
    const lead = m[1];
    const rest = m[2].trim();
    if (!p) return { pos: lead, team: rest };
    const pn = parseInt(p, 10);
    const ln = parseInt(lead, 10);
    if (!Number.isNaN(pn) && !Number.isNaN(ln) && pn === ln) return { pos: p, team: rest };
    return { pos: p, team: t };
}

async function init() {
    const keys = ['PREM', 'LALIGA', 'MLS'];
    allMatches = [];
    const dateMap = {};

    const pushMatch = (league, date, row) => {
        if (!date || !row[1] || !row[2]) return;
        const home = (row[1] || '').trim();
        const away = (row[2] || '').trim();
        allMatches.push({
            league,
            date,
            home,
            away,
            homeKey: canonicalTeamName(home),
            awayKey: canonicalTeamName(away),
            score: (row[3] || 'v').trim()
        });
        dateMap[date.getTime()] = true;
    };

    for (let k of keys) {
        await new Promise(res => {
            Papa.parse(SCHEDULE_URLS[k], {
                download: true,
                complete: (results) => {
                    let currentDate = null;
                    let awaitingDate = false;
                    let pendingMatchRows = [];

                    results.data.forEach((row, i) => {
                        if (i === 0) return;
                        const cellA = row[0];
                        const parsedA = cellA ? parseSheetDate(cellA) : null;

                        if (parsedA === 'MATCHDAY_MARKER') {
                            currentDate = null;
                            awaitingDate = true;
                            pendingMatchRows = [];
                            if (row[1] && row[2]) pendingMatchRows.push(row);
                            return;
                        }

                        if (awaitingDate) {
                            if (parsedA && parsedA !== 'MATCHDAY_MARKER') {
                                currentDate = parsedA;
                                awaitingDate = false;
                                pendingMatchRows.forEach(r => pushMatch(k, currentDate, r));
                                pendingMatchRows = [];
                                pushMatch(k, currentDate, row);
                            }
                            return;
                        }

                        if (parsedA && parsedA !== 'MATCHDAY_MARKER') currentDate = parsedA;
                        pushMatch(k, currentDate, row);
                    });

                    res();
                }
            });
        });
    }

    uniqueDates = Object.keys(dateMap).map(Number).sort((a,b) => a - b);
    if (uniqueDates.length > 0) jumpToToday();
    else {
        document.getElementById('dateText').textContent = "NO DATA FOUND";
    }
}

function jumpToToday() {
    const now = new Date();
    now.setHours(0, 0, 0, 0);
    const nowTime = now.getTime();

    let foundIdx = -1;
    for (let i = 0; i < uniqueDates.length; i++) {
        if (uniqueDates[i] >= nowTime) { foundIdx = i; break; }
    }
    if (foundIdx === -1) foundIdx = uniqueDates.length - 1;
    dateIdx = foundIdx;
    renderMatches();
}

function _makePlayerKey(league, teamKey, name) {

function _splitPlayerKey(key) {
    const parts = (key || '').split(':::');
    if (parts.length < 3) return { league: null, team: null, name: key };
    return { league: parts[0], team: parts[1], name: parts.slice(2).join(':::') };

function _editDistance(a, b, limit = 999) {
    a = _normMatch(a);
    b = _normMatch(b);
    if (a === b) return 0;
    if (!a) return b.length;
    if (!b) return a.length;

    const al = a.length, bl = b.length;
    if (Math.abs(al - bl) > limit) return limit + 1;

    const prev = new Array(bl + 1);
    const curr = new Array(bl + 1);
    for (let j = 0; j <= bl; j++) prev[j] = j;

    for (let i = 1; i <= al; i++) {
        curr[0] = i;
        let minRow = curr[0];
        const ca = a.charCodeAt(i - 1);
        for (let j = 1; j <= bl; j++) {
            const cost = ca === b.charCodeAt(j - 1) ? 0 : 1;
            const v = Math.min(prev[j] + 1, curr[j - 1] + 1, prev[j - 1] + cost);
            curr[j] = v;
            if (v < minRow) minRow = v;
        }
        if (minRow > limit) return limit + 1;
        for (let j = 0; j <= bl; j++) prev[j] = curr[j];
    }
    return prev[bl];
}

function _bestFuzzyPlayerMatch(query, candidates) {
    const q = _normMatch(query);
    if (!q) return null;

    let best = null;
    let best2 = null;

    for (const c of candidates) {
        const n1 = _normMatch(c.name);
        const lim = Math.max(2, Math.floor(Math.max(q.length, n1.length) * 0.25));
        const d = _editDistance(q, n1, lim);

        if (best === null || d < best.d) { best2 = best; best = { c, d }; }
        else if (best2 === null || d < best2.d) { best2 = { c, d }; }
    }

    if (!best) return null;

    const nameLen = Math.max(_normMatch(best.c.name).length, q.length);
    const threshold = Math.max(2, Math.floor(nameLen * 0.25));
    if (best.d > threshold) return null;
    if (best2 && best2.d === best.d) return null;

    return best.c;
}

function _bestFuzzyTeamMatch(query, candidates) {
    const q = _normMatch(query);
    if (!q) return null;

    let best = null;
    let best2 = null;

    for (const c of candidates) {
        const n1 = _normMatch(c.name);
        const lim = Math.max(2, Math.floor(Math.max(q.length, n1.length) * 0.25));
        const d = _editDistance(q, n1, lim);

        if (best === null || d < best.d) { best2 = best; best = { c, d }; }
        else if (best2 === null || d < best2.d) { best2 = { c, d }; }
    }

    if (!best) return null;

    const nameLen = Math.max(_normMatch(best.c.name).length, q.length);
    const threshold = Math.max(2, Math.floor(nameLen * 0.25));
    if (best.d > threshold) return null;
    if (best2 && best2.d === best.d) return null;

    return best.c;
}

    const logo = getLogo(teamName) || '';
    if (logo.includes('mlssoccer')) return 'MLS';
    if (logo.includes('premierleague')) return 'PREM';

}
function _findTeamLeague(teamName) {
    const tk = canonicalTeamName(teamName);
    const m = allMatches.find(x => x.homeKey === tk || x.awayKey === tk);
    if (m) return m.league;
    return _guessLeagueForTeam(teamName);
}

async function loadStats(league) {
    if (!STATS_URLS[league]) {
        statsData[league] = { goals: [], assists: [], cleanSheets: [], ratings: [], players: {}, loaded: true };
        return;
    }
    if (statsData[league] && statsData[league].loaded) return;

    const src = STATS_URLS[league];
    const data = { goals: [], assists: [], cleanSheets: [], ratings: [], players: {}, loaded: false };

    const parseCsv = (url, header=false) => new Promise((resolve) => {
        if (!url) return resolve([]);
        Papa.parse(url, {
            download: true,
            header: !!header,
            complete: (r) => resolve(r.data || []),
            error: () => resolve([])
        });
    });

    const upsertPlayer = (name, team) => {
        const n = (name || '').toString().trim();
        const t = (team || '').toString().trim();
        if (!n) return null;

        const teamKey = canonicalTeamName(t);
        const key = _makePlayerKey(league, teamKey, n);

        if (!data.players[key]) {
            data.players[key] = {
                key,
                league,
                name: n,
                team: t,
                teamKey,
                goals: 0,
                assists: 0,
                cleanSheets: 0,
                avgRating: null,
                matches: 0,
                recentRatings: [],
                position: '',
                photoUrl: ''
            };
        } else {
            if (t && !data.players[key].team) {
                data.players[key].team = t;
                data.players[key].teamKey = teamKey;
            }
        }
        return data.players[key];
    };

    const ingestABC = async (url, field, outArr) => {
        const rows = await parseCsv(url, false);
        rows.forEach((row, i) => {
            if (!Array.isArray(row)) return;
            const a = (row[0] || '').toString().trim();
            const b = (row[1] || '').toString().trim();
            const c = (row[2] || '').toString().trim();
            if (!a) return;
            if (i === 0 && (a.toLowerCase() === 'player' || a.toLowerCase().includes('name'))) return;

            const val = parseInt(b, 10);
            const p = upsertPlayer(a, c);
            if (!p) return;

            p[field] = Number.isNaN(val) ? (p[field] || 0) : val;
            outArr.push({ name: p.name, value: p[field] || 0, team: p.team, league, key: p.key });
        });
    };

    try {
        await ingestABC(src.goals, 'goals', data.goals);
        await ingestABC(src.assists, 'assists', data.assists);
        await ingestABC(src.cleanSheets, 'cleanSheets', data.cleanSheets);

        if (src.avgRatings) {
            const objRows = await parseCsv(src.avgRatings, true);
            const isObj = objRows.length && typeof objRows[0] === 'object' && !Array.isArray(objRows[0]);

            if (isObj) {
                objRows.forEach((r) => {
                    const name = (r.Player || r.Name || r['Player Name'] || r['player'] || '').toString().trim();
                    if (!name) return;
                    const team = (r.Team || r.Club || r['team'] || '').toString().trim();
                    const ratingRaw = (r.Avg || r['Avg Rating'] || r['Average Rating'] || r.Rating || r['rating'] || '').toString().trim();
                    const matchesRaw = (r.Matches || r.Games || r.Appearances || r['games'] || r['matches'] || '').toString().trim();
                    const pos = (r.Position || r.Pos || '').toString().trim();
                    const photo = (r.Photo || r.PhotoUrl || r['Photo URL'] || r['photo'] || '').toString().trim();

                    const p = upsertPlayer(name, team);
                    if (!p) return;

                    const val = parseFloat(ratingRaw);
                    if (!Number.isNaN(val)) p.avgRating = val;

                    const m = parseInt(matchesRaw, 10);
                    if (!Number.isNaN(m) && m > 0) p.matches = Math.max(p.matches || 0, m);

                    if (pos && !p.position) p.position = pos;
                    if (photo && !p.photoUrl) p.photoUrl = photo;

                    data.ratings.push({ name: p.name, value: (p.avgRating != null ? p.avgRating : 0), team: p.team, league, key: p.key, matches: p.matches || 0 });
                });
            } else {
                const rows = await parseCsv(src.avgRatings, false);
                rows.forEach((row, i) => {
                    if (!Array.isArray(row)) return;
                    const name = (row[0] || '').toString().trim();
                    const ratingRaw = (row[1] || '').toString().trim();
                    const team = (row[2] || '').toString().trim();
                    if (!name) return;
                    if (i === 0 && (name.toLowerCase() === 'player' || name.toLowerCase().includes('name'))) return;

                    const p = upsertPlayer(name, team);
                    if (!p) return;

                    const val = parseFloat(ratingRaw);
                    if (!Number.isNaN(val)) p.avgRating = val;

                    data.ratings.push({ name: p.name, value: (p.avgRating != null ? p.avgRating : 0), team: p.team, league, key: p.key, matches: p.matches || 0 });
                });
            }
        }

        if (src.ratingsLog) {
            const objRows = await parseCsv(src.ratingsLog, true);
            const isObj = objRows.length && typeof objRows[0] === 'object' && !Array.isArray(objRows[0]);

            if (isObj) {
                objRows.forEach((r) => {
                    const name = (r.Player || r.Name || r['Player Name'] || r['player'] || '').toString().trim();
                    if (!name) return;

                    const team = (r.Team || r.Club || r['team'] || '').toString().trim();
                    const ratingRaw = (r.Rating || r.Score || r['Match Rating'] || r['rating'] || '').toString().trim();
                    const date = (r.Date || r.MatchDate || r['Date'] || '').toString().trim();
                    const opp = (r.Opponent || r.Opp || r['Opponent'] || '').toString().trim();

                    const rating = parseFloat(ratingRaw);
                    if (Number.isNaN(rating)) return;

                    const p = upsertPlayer(name, team);
                    if (!p) return;

                    p.matches = (p.matches || 0) + 1;
                    p.recentRatings.push({ date, opponent: opp, rating });
                });
            } else {
                const rows = await parseCsv(src.ratingsLog, false);
                rows.forEach((row, i) => {
                    if (!Array.isArray(row)) return;
                    const name = (row[0] || '').toString().trim();
                    const ratingRaw = (row[1] || '').toString().trim();
                    const team = (row[2] || '').toString().trim();
                    const date = (row[3] || '').toString().trim();
                    const opp = (row[4] || '').toString().trim();
                    if (!name) return;
                    if (i === 0 && (name.toLowerCase() === 'player' || name.toLowerCase().includes('name'))) return;

                    const rating = parseFloat(ratingRaw);
                    if (Number.isNaN(rating)) return;

                    const p = upsertPlayer(name, team);
                    if (!p) return;

                    p.matches = (p.matches || 0) + 1;
                    p.recentRatings.push({ date, opponent: opp, rating });
                });
            }
        }

        const dedupeByKey = (arr) => {
            const seen = new Map();
            arr.forEach(x => { if (x && x.key && !seen.has(x.key)) seen.set(x.key, x); });
            return Array.from(seen.values());
        };

        data.goals = dedupeByKey(data.goals);
        data.assists = dedupeByKey(data.assists);
        data.cleanSheets = dedupeByKey(data.cleanSheets);

        if (data.ratings && data.ratings.length) {
            const byKey = new Map();
            data.ratings.forEach(x => {
                if (!x || !x.key) return;
                if (!byKey.has(x.key) || (x.value && !byKey.get(x.key).value)) byKey.set(x.key, x);
            });
            data.ratings = Array.from(byKey.values());
        }

        const rankInt = (arr) => {
            arr.sort((a,b) => (parseInt(b.value,10) || 0) - (parseInt(a.value,10) || 0));
            arr.forEach((x,i)=>x.rank=i+1);
        };
        const rankFloat = (arr) => {
            arr.sort((a,b) => (parseFloat(b.value) || 0) - (parseFloat(a.value) || 0));
            arr.forEach((x,i)=>x.rank=i+1);
        };
        rankInt(data.goals);
        rankInt(data.assists);
        rankInt(data.cleanSheets);
        rankFloat(data.ratings);

        Object.values(data.players).forEach(p => {
            if (!p || !p.recentRatings) return;
            if (p.recentRatings.length > 5) p.recentRatings = p.recentRatings.slice(-5);
        });

        data.loaded = true;
        statsData[league] = data;
    } catch (e) {
        statsData[league] = { goals: [], assists: [], cleanSheets: [], ratings: [], players: {}, loaded: true };
    }
}

/* live autofill suggestions */
let __suggestTimer = null;
let __searchIndexBuilt = false;
let __searchIndex = { players: [], teams: [] };

async function ensureSearchIndex() {
    if (__searchIndexBuilt) return;

    await Promise.all([loadStats('PREM'), loadStats('LALIGA'), loadStats('MLS')]);

    const players = [];
    ['PREM','LALIGA','MLS'].forEach(lg => {
        const obj = (statsData[lg] && statsData[lg].players) ? statsData[lg].players : {};
        Object.keys(obj).forEach(k => {
            const p = obj[k];
            if (!p || !p.name) return;
            players.push({ type:'player', key: p.key, name: p.name, team: p.team || '', league: lg });
        });
    });

    const teamRep = {};
    const addTeam = (t, lgHint=null) => {
        if (!t) return;
        const k = canonicalTeamName(t);
        if (!k) return;
        if (!teamRep[k]) teamRep[k] = { type:'team', name: t, league: lgHint || _findTeamLeague(t) };
    };

    (allMatches || []).forEach(m => { addTeam(m.home, m.league); addTeam(m.away, m.league); });
    Object.keys(LOGOS || {}).forEach(t => addTeam(t, _guessLeagueForTeam(t)));
    Object.keys(TEAM_ALIASES || {}).forEach(a => addTeam(TEAM_ALIASES[a], _guessLeagueForTeam(TEAM_ALIASES[a])));

    __searchIndex.players = players;
    __searchIndex.teams = Object.values(teamRep);
    __searchIndexBuilt = true;
}

function queueSuggestions(inputId, boxId) {
    clearTimeout(__suggestTimer);
    __suggestTimer = setTimeout(() => {
        const el = document.getElementById(inputId);
        if (!el) return;
        showSearchSuggestions(el.value, inputId, boxId);
    }, 90);
}

async function showSearchSuggestions(query, inputId, boxId) {
    const box = document.getElementById(boxId);
    const input = document.getElementById(inputId);
    if (!box || !input) return;

    const q = (query || '').trim();
    if (q.length < 1) { box.classList.add('hidden'); box.innerHTML=''; return; }

    await ensureSearchIndex();

    const qn = _normMatch(q);

    const pMatches = __searchIndex.players
        .filter(p => _normMatch(p.name).includes(qn))
        .slice(0, 8);

    const tMatches = __searchIndex.teams
        .filter(t => _normMatch(t.name).includes(qn))
        .slice(0, 6);

    const items = [...pMatches, ...tMatches].slice(0, 12);

    if (!items.length) { box.classList.add('hidden'); box.innerHTML=''; return; }

    box.innerHTML = items.map(item => {
        if (item.type === 'player') {
            return `<div class="search-suggestion" onclick="selectSuggestion('player','${_jsEscapeSingle(item.key)}','${_jsEscapeSingle(item.name)}','${inputId}','${boxId}')">
                <span class="text-[#00ff85] font-black">P</span>
                <div class="flex flex-col leading-tight">
                    <span class="font-bold">${item.name}</span>
                    <span class="text-zinc-500 text-[10px]">${item.team}</span>
                </div>
            </div>`;
        }
        return `<div class="search-suggestion" onclick="selectSuggestion('team','${_jsEscapeSingle(item.name)}','${_jsEscapeSingle(item.name)}','${inputId}','${boxId}')">
            <span class="text-[#00ff85] font-black">T</span>
            <div class="flex items-center gap-2">
                <img src="${getLogo(item.name)}" class="w-4 h-4 object-contain">
                <span class="font-bold">${item.name}</span>
            </div>
        </div>`;
    }).join('');

    box.classList.remove('hidden');
}

function selectSuggestion(type, value, displayName, inputId, boxId) {
    const input = document.getElementById(inputId);
    const box = document.getElementById(boxId);
    if (input) input.value = displayName || value;
    if (box) { box.classList.add('hidden'); box.innerHTML=''; }

    if (type === 'player') viewPlayer(value);
    else viewTeam(value, _findTeamLeague(value));
}

document.addEventListener('click', (e) => {
    const box = document.getElementById('globalSearchSuggestions');
    const input = document.getElementById('globalSearch');
    if (!box || !input) return;
    if (box.contains(e.target) || input.contains(e.target)) return;
    box.classList.add('hidden');
});

function _teamLeaders(players){
    const valid = (players || []).slice();

    const goalsSorted = valid.slice().sort((a,b)=> (b.goals||0)-(a.goals||0));
    const assistsSorted = valid.slice().sort((a,b)=> (b.assists||0)-(a.assists||0));
    const ratingSorted = valid.slice().sort((a,b)=> (Number(b.avgRating||0))-(Number(a.avgRating||0)));

    const goalsLeader = goalsSorted[0] || null;
    const assistsLeader = assistsSorted[0] || null;
    const ratingLeader = ratingSorted[0] || null;

    return { goalsLeader, assistsLeader, ratingLeader, goalsSorted, assistsSorted, ratingSorted };
}

function showTeamLeaderboard(type){
    const box = document.getElementById('teamLeaderboard');
    if (!box) return;

    const players = currentTeamPlayersList || [];
    const { goalsSorted, assistsSorted, ratingSorted } = _teamLeaders(players);

    let title = '';
    let list = [];
    if (type === 'goals') { title = 'Goals Leaderboard'; list = goalsSorted; }
    else if (type === 'assists') { title = 'Assists Leaderboard'; list = assistsSorted; }
    else { title = 'Match Rating Leaderboard'; list = ratingSorted; }
    const filteredList = (list || []).filter(p => {
        if (!p || !p.name) return false;
        if (type === 'goals') return (p.goals || 0) > 0;
        if (type === 'assists') return (p.assists || 0) > 0;
        return Number(p.avgRating || 0) > 0;
    });

    const rows = filteredList.map((p, idx) => {
        const val = type === 'goals' ? (p.goals||0) : type === 'assists' ? (p.assists||0) : _fmtRating(p.avgRating);
        return `
            <div class="flex items-center justify-between py-2 border-b border-zinc-800/40 last:border-b-0">
                <div class="flex items-center gap-3">
                    <div class="text-[10px] font-black text-zinc-500 w-6">${idx+1}</div>
                    <div class="font-bold cursor-pointer hover:text-[#00ff85]" onclick="viewPlayer('${_jsEscapeSingle(p.key)}')">${p.name}</div>
                </div>
                <div class="font-black text-[#00ff85] font-mono">${val}</div>
            </div>
        `;
    }).join('');

    box.innerHTML = `
        <div class="text-[10px] font-black text-zinc-500 uppercase mb-2">${title}</div>
        <div class="bg-zinc-900/40 border border-zinc-800 rounded-xl p-3">
            ${rows || '<div class="text-zinc-500 text-sm py-2">No data yet.</div>'}
        </div>
    `;
}

async function renderStats(lg) {
    document.querySelectorAll('[id^="stat-btn-"]').forEach(b => b.classList.remove('active-league'));
    const btn = document.getElementById(`stat-btn-${lg}`);
    if (btn) btn.classList.add('active-league');

    if (lg === 'COMBINED') {
        await Promise.all([loadStats('PREM'), loadStats('LALIGA'), loadStats('MLS')]);

        const cloneArr = (arr) => (arr || []).map(x => ({ ...x }));

        const combined = { goals: [], assists: [], cleanSheets: [], ratings: [], players: {}, loaded: true };
        ['PREM','LALIGA','MLS'].forEach(l => {
            const d = statsData[l] || {};
            combined.goals = combined.goals.concat(cloneArr(d.goals || []));
            combined.assists = combined.assists.concat(cloneArr(d.assists || []));
            combined.cleanSheets = combined.cleanSheets.concat(cloneArr(d.cleanSheets || []));
            combined.ratings = combined.ratings.concat(cloneArr(d.ratings || []));
            Object.assign(combined.players, d.players || {});
        });

        const rankInt = (arr) => {
            arr.sort((a,b) => (parseInt(b.value,10) || 0) - (parseInt(a.value,10) || 0));
            arr.forEach((x,i)=>x.rank=i+1);
        };
        const rankFloat = (arr) => {
            arr.sort((a,b) => (parseFloat(b.value) || 0) - (parseFloat(a.value) || 0));
            arr.forEach((x,i)=>x.rank=i+1);
        };
        rankInt(combined.goals);
        rankInt(combined.assists);
        rankInt(combined.cleanSheets);
        rankFloat(combined.ratings);

        statsData.COMBINED = combined;
    } else {
        await loadStats(lg);
    }

    const data = statsData[lg];
    const el = document.getElementById('statsContent');

    const makeList = (title, arr, valueLabel, kind, league) => {
        // Filter out 0 values for leaderboard categories (and protect against nulls)
        const filtered = (arr || []).filter(p => {
            const v = Number(p.value);
            if (Number.isNaN(v)) return false;
            // Ratings: keep only > 0
            if (kind === 'RATING') return v > 0;
            // All other categories: keep only > 0
            return v > 0;
        });

        // Keep your existing "top list" view compact
        const top = filtered.slice(0, 10);

        return `
            <div class="stat-card mb-4">
                <div class="flex items-center justify-between">
                    <div class="text-sm font-black uppercase">${title}</div>
                    <div class="flex items-center gap-3">
                        <button class="text-[10px] font-black text-[#00ff85] hover:underline"
                            onclick="openFullLeaderboard('${kind}', '${league}')">
                            SHOW FULL LEADERBOARD
                        </button>
                        <div class="text-[10px] font-black text-zinc-500 uppercase">${valueLabel}</div>
                    </div>
                </div>
                <div class="mt-3">
                    ${top.map((p) => `
                        <div class="flex items-center justify-between py-2 border-b border-zinc-800/40 last:border-b-0">
                            <div class="flex items-center gap-3">
                                <div class="text-[10px] font-black text-zinc-500 w-6">${p.rank || ''}</div>
                                <img src="${getLogo(p.team)}" class="w-5 h-5 object-contain">
                                <div class="flex flex-col leading-tight">
                                    <div class="font-bold cursor-pointer hover:underline" onclick="viewPlayer('${_jsEscapeSingle(p.key)}')">${p.name}</div>
                                    <div class="text-[10px] text-zinc-500 cursor-pointer hover:underline" onclick="viewTeam('${_jsEscapeSingle(p.team)}', '${p.league || league}')">${p.team}</div>
                                </div>
                            </div>
                            <div class="font-black text-[#00ff85]">${valueLabel === 'RATING' ? (Number(p.value).toFixed(2)) : p.value}</div>
                        </div>
                    `).join('')}
                    ${filtered.length === 0 ? `<div class="text-sm text-zinc-500 py-3">No players to show.</div>` : ``}
                </div>
            </div>`;
    };
    const goalieCleanSheets = (data.cleanSheets || []).filter(cs => {
        const pl = (data.players && data.players[cs.key]) ? data.players[cs.key] : null;
        return _isGoalie(pl);
    });

    el.innerHTML = `
        ${makeList('Goals', data.goals, 'GOALS', 'GOALS', lg)}
        ${makeList('Assists', data.assists, 'ASSISTS', 'ASSISTS', lg)}
        ${makeList('Clean Sheets', goalieCleanSheets, 'CLEAN', 'CLEAN', lg)}
        ${makeList('Average Rating', data.ratings, 'RATING', 'RATING', lg)}
    `;
}

function openFullLeaderboard(kind, league) {
    const modal = _ensureFullLeaderboardModal();
    const data = statsData[league] || { goals: [], assists: [], cleanSheets: [], ratings: [], players: {} };

    let title = '';
    let valueHdr = '';
    let arr = [];

    if (kind === 'GOALS') {
        title = 'Goals';
        valueHdr = 'Goals';
        arr = (data.goals || []);
    } else if (kind === 'ASSISTS') {
        title = 'Assists';
        valueHdr = 'Assists';
        arr = (data.assists || []);
    } else if (kind === 'CLEAN') {
        title = 'Clean Sheets';
        valueHdr = 'Clean';
        // Only goalies for clean sheets (same logic as the compact view)
        arr = (data.cleanSheets || []).filter(cs => {
            const pl = (data.players && data.players[cs.key]) ? data.players[cs.key] : null;
            return _isGoalie(pl);
        });
    } else if (kind === 'RATING') {
        title = 'Average Rating';
        valueHdr = 'Rating';
        arr = (data.ratings || []);
    }

    // Filter out zeros
    const filtered = (arr || []).filter(p => {
        const v = Number(p.value);
        return !Number.isNaN(v) && v > 0;
    });

    // Add games played (matches) via players map when available
    const enriched = filtered.map(p => {
        const pl = (data.players && data.players[p.key]) ? data.players[p.key] : null;
        let gp = (p.matches != null ? Number(p.matches) : (pl && pl.matches != null ? Number(pl.matches) : 0)) || 0;

        // Fix: when Avg Rating rows don't carry GP (or team names differ), fall back to matching by player name
        if (!gp && kind === 'RATING' && p.name && data.players) {
            const nm = p.name.toString().trim().toLowerCase();
            let best = 0;
            Object.values(data.players).forEach(x => {
                if ((x && x.name ? x.name : '').toString().trim().toLowerCase() === nm) {
                    const mv = Number(x.matches) || 0;
                    if (mv > best) best = mv;
                }
            });
            gp = best || gp;
        }
        return { ...p, matches: gp };
    });

    // Sort (desc)
    enriched.sort((a, b) => Number(b.value) - Number(a.value));

    // Assign ranks (simple 1..n)
    const ranked = enriched.map((p, idx) => ({ ...p, rank: idx + 1 }));

    document.getElementById('full-leaderboard-title').textContent = `${title} Leaderboard`;
    document.getElementById('full-leaderboard-subtitle').textContent = league === 'COMBINED' ? 'Combined leagues' : league;
    document.getElementById('full-leaderboard-valuehdr').textContent = valueHdr;

    const body = document.getElementById('full-leaderboard-body');
    if (!ranked.length) {
        body.innerHTML = `<div class="py-4 text-sm text-zinc-400">No players to show.</div>`;
    } else {
        body.innerHTML = ranked.map(p => `
            <div class="grid grid-cols-12 gap-2 py-2 items-center">
                <div class="col-span-1 text-[11px] font-black text-zinc-500">${p.rank}</div>
                <div class="col-span-5 flex items-center gap-3">
                    <img src="${getLogo(p.team)}" class="w-5 h-5 object-contain">
                    <div class="min-w-0">
                        <div class="font-bold truncate cursor-pointer hover:underline" onclick="viewPlayer('${_jsEscapeSingle(p.key)}')">${p.name}</div>
                    </div>
                </div>
                <div class="col-span-3 text-[11px] text-zinc-300 truncate cursor-pointer hover:underline" onclick="viewTeam('${_jsEscapeSingle(p.team)}', '${p.league || league}')">${p.team}</div>
                <div class="col-span-1 text-right text-[11px] text-zinc-300">${p.matches || 0}</div>
                <div class="col-span-2 text-right font-black text-[#00ff85]">${kind === 'RATING' ? Number(p.value).toFixed(2) : p.value}</div>
            </div>
        `).join('');
    }

    modal.classList.remove('hidden');
}

/* UPDATED: clickable team names in last/next lists */
function _matchRowClickable(m, highlightWinner = false) {
    const homeLg = _leagueForTeamFast(m.home);
    const awayLg = _leagueForTeamFast(m.away);

    // Winner highlighting (optional)
    let homeWin = false, awayWin = false;
    if (highlightWinner) {
        const s = (m.score || '').toString();
        const mm = s.match(/(\d+)\s*[-‚Äì‚Äî:]\s*(\d+)/);
        if (mm) {
            const hg = parseInt(mm[1], 10);
            const ag = parseInt(mm[2], 10);
            if (!Number.isNaN(hg) && !Number.isNaN(ag)) {
                if (hg > ag) homeWin = true;
                else if (ag > hg) awayWin = true;
            }
        }
    }

    return `
        <div class="flex items-center justify-between py-2 border-b border-zinc-800/40 last:border-b-0">
            <div class="flex items-center gap-2 flex-wrap">
                <span class="text-[10px] font-black text-zinc-500 w-12">${_formatShortDate(m.date)}</span>

                <img src="${getLogo(m.home)}" class="w-4 h-4 object-contain">
                <button class="text-[11px] ${homeWin ? 'font-black' : 'font-normal'} hover:text-...am('${_jsEscapeSingle(m.home)}','${homeLg}')">${m.home}</button>

                <span class="text-zinc-500 text-[10px] font-black">vs</span>

                <button class="text-[11px] ${awayWin ? 'font-black' : 'font-normal'} hover:text-...am('${_jsEscapeSingle(m.away)}','${awayLg}')">${m.away}</button>
                <img src="${getLogo(m.away)}" class="w-4 h-4 object-contain">
            </div>
            <div class="font-mono text-[#00ff85] font-black">${m.score}</div>
        </div>
    `;
}

async function viewTeam(teamName, league) {
    currentTeam = { name: teamName, league };
    document.getElementById('team-tab').classList.remove('hidden');
    document.getElementById('hub-tab').classList.add('hidden');
    document.getElementById('standings-tab').classList.add('hidden');
    document.getElementById('stats-tab').classList.add('hidden');
    document.getElementById('player-tab').classList.add('hidden');

    const content = document.getElementById('teamContent');
    content.innerHTML = '<div class="text-center text-zinc-500 py-8">Loading team...</div>';

    await loadStats(league);

    const tk = canonicalTeamName(teamName);
    const teamPlayers = Object.values(statsData[league].players || {}).filter(p => canonicalTeamName(p.team) === tk);

    // --- Table snapshot (current position with one above/below) ---
    const standingsRows = await loadStandingsData(league);
    const tableSnapshotHTML = (() => {
        if (!standingsRows || !standingsRows.length) return '';

        const tk2 = canonicalTeamName(teamName);
        const idx = standingsRows.findIndex(r => canonicalTeamName(r.team) === tk2);
        if (idx === -1) return '';

        const start = Math.max(0, idx - 1);
        const end = Math.min(standingsRows.length - 1, idx + 1);
        const slice = standingsRows.slice(start, end + 1);

        const rowHTML = (r) => {
            const isCurrent = canonicalTeamName(r.team) === tk2;
            const base = isCurrent ? 'border-[#00ff85] bg-zinc-900/70' : 'border-zinc-800 bg-zinc-900/40 hover:border-[#00ff85]';
            return `
                <div class="flex items-center justify-between py-2 px-2 rounded-lg border ${base} cursor-pointer"
                     onclick="viewTeam('${_jsEscapeSingle(r.team)}','${league}')">
                    <div class="flex items-center gap-3">
                        <div class="text-[10px] font-black text-zinc-500 w-6">${r.pos}</div>
                        <div class="flex items-center gap-2">
                            <img src="${getLogo(r.team)}" class="w-4 h-4 object-contain">
                            <div class="font-bold ${isCurrent ? 'text-[#00ff85]' : ''}">${r.team}</div>
                        </div>
                    </div>
                    <div class="flex items-center gap-4 font-mono text-[11px]">
                        <div class="text-zinc-400">${r.wdl}</div>
                        <div class="${isCurrent ? 'text-[#00ff85]' : 'text-zinc-200'} font-black">${r.pts}</div>
                    </div>
                </div>
            `;
        };

        return `
            <div class="mt-4 stat-card">
                <div class="flex items-center justify-between">
                    <div class="text-[10px] font-black text-zinc-500 uppercase">Table Snapshot</div>
                    <button class="text-[10px] font-black text-[#00ff85] hover:opacity-80" onclick="goToStandingsFromTeam('${league}')">VIEW FULL TABLE</button>
                </div>
                <div class="mt-2 grid grid-cols-1 gap-2">
                    ${slice.map(rowHTML).join('')}
                </div>
                <div class="mt-2 text-[10px] text-zinc-500 font-black uppercase flex items-center justify-between">
                    <span>W-D-L</span><span>PTS</span>
                </div>
            </div>
        `;
    })();

    currentTeamPlayersList = teamPlayers.slice();
    currentTeamLeague = league;
    currentTeamName = teamName;

    const { goalsLeader, assistsLeader, ratingLeader } = _teamLeaders(teamPlayers);

    const teamMatchesAll = allMatches
        .filter(m => m.league === league && (m.homeKey === tk || m.awayKey === tk))
        .slice()
        .sort((a,b)=>a.date-b.date);

    const today = new Date(); today.setHours(0,0,0,0);

    const played = teamMatchesAll.filter(m => (m.score || '').trim().toLowerCase() !== 'v');
    const upcoming = teamMatchesAll.filter(m => (m.score || '').trim().toLowerCase() === 'v' && m.date >= today);

    const last5 = played.slice().sort((a,b)=>b.date-a.date).slice(0,5).reverse();
    const next5 = upcoming.slice(0,5);

    content.innerHTML = `
        <div class="stat-card">
            <div class="flex items-center gap-3">
                <img src="${getLogo(teamName)}" class="w-10 h-10 object-contain">
                <div class="flex flex-col">
                    <div class="text-xl font-black">${teamName}</div>
                    <div class="text-zinc-500 text-xs font-black uppercase">${LEAGUE_META[league].name}</div>
                </div>
            </div>
        </div>

        ${tableSnapshotHTML}

        <div class="mt-4 grid grid-cols-1 gap-3">
            <div class="leader-pill" onclick="showTeamLeaderboard('goals')">
                <div class="text-[10px] font-black text-zinc-500 uppercase">Leading Goal Scorer</div>
                <div class="mt-1 flex items-center justify-between">
                    <div class="font-black">${goalsLeader ? goalsLeader.name : '-'}</div>
                    <div class="font-black text-[#00ff85] font-mono">${goalsLeader ? (goalsLeader.goals||0) : '-'}</div>
                </div>
                <div class="text-[10px] text-zinc-500 mt-1">Tap to view full goals leaderboard</div>
            </div>

            <div class="leader-pill" onclick="showTeamLeaderboard('assists')">
                <div class="text-[10px] font-black text-zinc-500 uppercase">Assist Leader</div>
                <div class="mt-1 flex items-center justify-between">
                    <div class="font-black">${assistsLeader ? assistsLeader.name : '-'}</div>
                    <div class="font-black text-[#00ff85] font-mono">${assistsLeader ? (assistsLeader.assists||0) : '-'}</div>
                </div>
                <div class="text-[10px] text-zinc-500 mt-1">Tap to view full assists leaderboard</div>
            </div>

            <div class="leader-pill" onclick="showTeamLeaderboard('ratings')">
                <div class="text-[10px] font-black text-zinc-500 uppercase">Rating Leader</div>
                <div class="mt-1 flex items-center justify-between">
                    <div class="font-black">${ratingLeader ? ratingLeader.name : '-'}</div>
                    <div class="font-black text-[#00ff85] font-mono">${ratingLeader ? _fmtRating(ratingLeader.avgRating) : '-'}</div>
                </div>
                <div class="text-[10px] text-zinc-500 mt-1">Tap to view full ratings leaderboard</div>
            </div>
        </div>

        <div id="teamLeaderboard" class="mt-4"></div>

        <div class="mt-4 stat-card">
            <div class="text-[10px] font-black text-zinc-500 uppercase">Players</div>
            <div class="mt-2 grid grid-cols-1 gap-2">
                ${teamPlayers
                    .sort((a,b)=>a.name.localeCompare(b.name))
                    .map(p=>`
                    <div class="flex items-center justify-between py-2 border-b border-zinc-800/40 last:border-b-0">
                        <div class="font-bold cursor-pointer hover:text-[#00ff85]" onclick="viewPlayer('${_jsEscapeSingle(p.key)}')">${p.name}</div>
                        <div class="text-zinc-500 text-[10px] font-black">‚Üí</div>
                    </div>
                `).join('') || '<div class="text-zinc-500 text-sm py-2">No players found.</div>'}
            </div>
        </div>

        <div class="mt-4 stat-card">
            <div class="text-[10px] font-black text-zinc-500 uppercase">Last 5 Results</div>
            <div class="mt-2">
                ${last5.map(m => _matchRowClickable(m, true)).join('') || '<div class="text-zinc-500 text-sm py-2">No results yet.</div>'}
            </div>
        </div>

        <div class="mt-4 stat-card">
            <div class="text-[10px] font-black text-zinc-500 uppercase">Next 5 Matches</div>
            <div class="mt-2">
                ${next5.map(_matchRowClickable).join('') || '<div class="text-zinc-500 text-sm py-2">No upcoming matches found.</div>'}
            </div>
        </div>
    `;

    showTeamLeaderboard('goals');
}

async function viewPlayer(playerKeyOrName) {
    document.getElementById('player-tab').classList.remove('hidden');
    document.getElementById('hub-tab').classList.add('hidden');
    document.getElementById('standings-tab').classList.add('hidden');
    document.getElementById('stats-tab').classList.add('hidden');
    document.getElementById('team-tab').classList.add('hidden');

    const content = document.getElementById('playerContent');
    content.innerHTML = '<div class="text-center text-zinc-500 py-8">Loading player...</div>';

    const parts = _splitPlayerKey(playerKeyOrName);
    if (parts.league) await loadStats(parts.league);
    await Promise.all([loadStats('PREM'), loadStats('LALIGA'), loadStats('MLS')]);

    let playerData = null;

    if (parts.league) {
        const pool = statsData[parts.league].players || {};
        const exactKey = _makePlayerKey(parts.league, parts.team, parts.name);
        playerData = pool[exactKey] || null;

        if (!playerData) {
            const candidates = Object.values(pool).map(p => ({ key: p.key, name: p.name, team: p.team }));
            const m = _bestFuzzyPlayerMatch(parts.name, candidates);
            if (m && pool[m.key]) playerData = pool[m.key];
        }
    } else {
        for (const lg of ['PREM', 'LALIGA', 'MLS']) {
            const pool = statsData[lg].players || {};
            if (pool[playerKeyOrName]) { playerData = pool[playerKeyOrName]; break; }
        }
    }

    if (!playerData) {
        const candidates = [];
        ['PREM','LALIGA','MLS'].forEach(lg => {
            const pool = statsData[lg].players || {};
            Object.values(pool).forEach(p => candidates.push({ key: p.key, name: p.name, team: p.team }));
        });

        const m = _bestFuzzyPlayerMatch(playerKeyOrName, candidates);
        if (m) {
            for (const lg of ['PREM','LALIGA','MLS']) {
                const pool = statsData[lg].players || {};
                if (pool[m.key]) { playerData = pool[m.key]; break; }
            }
        }
    }

    if (!playerData) {
        content.innerHTML = '<div class="text-center text-zinc-500 py-8">Player not found</div>';
        return;
    }

    const isGK = _isGoalie(playerData);

    content.innerHTML = `
        <div class="stat-card">
            <div class="flex items-center gap-4">
                ${renderPlayerAvatarHTML(playerData.name, playerData.team)}
                <div class="flex-1">
                    <div class="flex items-center justify-center gap-2">
                        <h2 class="text-2xl font-black">${playerData.name}</h2>
                    </div>
                    <p class="text-zinc-500 text-sm flex items-center justify-center gap-2">
                        <img src="${getLogo(playerData.team)}" class="w-4 h-4 object-contain">
                        <span class="cursor-pointer hover:text-[#00ff85]" onclick="viewTeam('${_jsEscapeSingle(playerData.team)}', '${playerData.league}')">${playerData.team}</span>
                    </p>
                </div>
            </div>
        </div>

        <div class="mt-6 stat-card">
            <div class="text-[10px] font-black text-zinc-500 uppercase mb-2">Last 5 Match Ratings</div>
            <div class="flex gap-2 flex-wrap">
                ${(playerData.recentRatings && playerData.recentRatings.length ? playerData.recentRatings.slice(-5) : []).map(r => `
                    <div class="${_ratingClass(r.rating)}">
                        ${(r.rating != null ? Number(r.rating).toFixed(1) : '-')}
                    </div>
                `).join('') || '<div class="text-zinc-500 text-sm">No ratings yet</div>'}
            </div>
        </div>

        <div class="grid grid-cols-${isGK ? 4 : 3} gap-3 mt-6">
            <div class="stat-card text-center relative overflow-hidden">
                <div class="text-[10px] font-black text-zinc-500 uppercase">Goals</div>
                <div class="text-2xl font-black text-[#00ff85] mt-1">${playerData.goals || 0}</div>
                <img src="${getLogo(playerData.team)}" class="absolute right-2 bottom-2 w-12 h-12 object-contain opacity-10 pointer-events-none player-logo-dup">
            </div>
            <div class="stat-card text-center relative overflow-hidden">
                <div class="text-[10px] font-black text-zinc-500 uppercase">Assists</div>
                <div class="text-2xl font-black text-[#00ff85] mt-1">${playerData.assists || 0}</div>
                <img src="${getLogo(playerData.team)}" class="absolute right-2 bottom-2 w-12 h-12 object-contain opacity-10 pointer-events-none player-logo-dup">
            </div>
            ${isGK ? `
            <div class="stat-card text-center relative overflow-hidden">
                <div class="text-[10px] font-black text-zinc-500 uppercase">Clean Sheets</div>
                <div class="text-2xl font-black text-[#00ff85] mt-1">${playerData.cleanSheets || 0}</div>
                <img src="${getLogo(playerData.team)}" class="absolute right-2 bottom-2 w-12 h-12 object-contain opacity-10 pointer-events-none player-logo-dup">
            </div>
            ` : ``}
            <div class="stat-card text-center relative overflow-hidden">
                <div class="text-[10px] font-black text-zinc-500 uppercase">Games</div>
                <div class="text-2xl font-black text-[#00ff85] mt-1">${playerData.matches || 0}</div>
                <img src="${getLogo(playerData.team)}" class="absolute right-2 bottom-2 w-12 h-12 object-contain opacity-10 pointer-events-none player-logo-dup">
            </div>
        </div>

        <div class="mt-6 grid grid-cols-2 gap-3">
            <div class="stat-card text-center">
                <div class="text-[10px] font-black text-zinc-500 uppercase">Avg Rating</div>
                <div class="text-2xl font-black text-[#00ff85] mt-1">${playerData.avgRating != null ? Number(playerData.avgRating).toFixed(2) : '-'}</div>
            </div>
            <div class="stat-card text-center">
                <div class="text-[10px] font-black text-zinc-500 uppercase">League</div>
                <div class="text-xl font-black mt-2">${(playerData.league || '').toUpperCase()}</div>
            </div>
        </div>
    `;
}

async function searchPlayer(e) {
    if (e.key !== 'Enter') return;
    const query = document.getElementById('globalSearch').value.trim();
    if (!query) return;

    await Promise.all([loadStats('PREM'), loadStats('LALIGA'), loadStats('MLS')]);
    await ensureSearchIndex();

    const playerCandidates = [];
    ['PREM', 'LALIGA', 'MLS'].forEach(lg => {
        const players = statsData[lg].players ? Object.values(statsData[lg].players) : [];
        players.forEach(p => {
            if (p && p.key && p.name) playerCandidates.push({ key: p.key, name: p.name, team: p.team || '' });
        });
    });

    const matchedPlayer = _bestFuzzyPlayerMatch(query, playerCandidates);
    if (matchedPlayer) {
        viewPlayer(matchedPlayer.key);
        return;
    }

    const teamCandidates = (__searchIndex.teams || []).map(t => ({ name: t.name, league: t.league }));
    const matchedTeam = _bestFuzzyTeamMatch(query, teamCandidates);

    if (matchedTeam) {
        viewTeam(matchedTeam.name, _findTeamLeague(matchedTeam.name));
        return;
    }

    viewTeam(query, _findTeamLeague(query));
}

init();
